
SET statement_timeout = 0;
SET lock_timeout = 0;
SET idle_in_transaction_session_timeout = 0;
SET client_encoding = 'UTF8';
SET standard_conforming_strings = on;
SET check_function_bodies = false;
SET client_min_messages = warning;
SET row_security = off;


CREATE USER iot WITH PASSWORD 'iot';

CREATE SCHEMA bi;


ALTER SCHEMA bi OWNER TO iot;


CREATE TABLE evaluation_confusion (
    row_id bigint,
    class double precision,
    confusion_arr numeric[]
);


ALTER TABLE evaluation_confusion OWNER TO iot;

-

CREATE TABLE measures (
    "timestamp" timestamp without time zone,
    totalmem bigint,
    freemem bigint,
    memusage numeric,
    cpus_0_speed numeric,
    cpus_0_sys numeric,
    cpus_1_speed numeric,
    cpus_1_sys numeric,
    cpus_1_idle numeric,
    loadavg_0 numeric,
    loadavg_1 numeric,
    loadavg_2 numeric,
    prediction numeric
);


ALTER TABLE measures OWNER TO iot;



